import styled, { ThemeProvider } from 'styled-components';
import { variant } from 'styled-system';

function Button(props) {
	const Button = styled('button')(
		{
			appearance: 'none',
			fontFamily: 'inherit',
		},

		variant({
			variants: {
				primary: {
					background: 'transparent',
					hover: 'rgb(116, 140, 248)',
					text: 'black',
				},
				secondary: {
					background: 'transparent',
					texhover: '#5e90e6',
					text: 'black',
				},
				pill: {
					background: '#6bbcff',
					hover: '#5e90e6',
					text: 'black',
				},
			},
		})
	);

	Button.defaultProps = {
		theme: {
			main: 'transparent',
		},
	};

	const theme = {
		default: {
			background: 'transparent',
			texhover: '#5e90e6',
			text: 'black',
		},
		pill: {
			background: '#6bbcff',
			hover: '#5e90e6',
			text: 'black',
		},
		primary: {
			background: 'transparent',
			hover: 'rgb(116, 140, 248)',
			text: 'black',
		},
	};

	return (
		<ThemeProvider>
			<Button>{props.children}</Button>
		</ThemeProvider>
	);
}

export default Button;
